submittedFiles.workflow:
version 1.0

import "sub/sub.wdl"
import "sub2/sub2.wdl" as sub2_import_alias

workflow main {
    meta {
        croo_out_def: "main.croo.json"
    }

    scatter(i in range(2)) {
        call t_main_1 { input:
            i = i,
        }
        call sub.sub { input:
            i = i,
        }
    }
    call t_main_1 as t_main_1_alias { input:
        i = -1,
    }

    call sub2_import_alias.sub2
    call sub2_import_alias.sub2 as sub2_alias
}

task t_main_1 {
    input {
        Int i
    }

    command {
        echo ~{i} > t_main_1.~{i}.out
        sleep 2
    }

    output {
        File out = "t_main_1.~{i}.out"
    }
}
